function processCheckBoxes(event)
{
	if (event)
	{
		if (event.target.checked)
		{
			cbRotX.checked = cbRotY.checked = cbRotY.checked = cbRotZ.checked = cbMovY.checked = cbMovX.checked= cbMovZ.checked= false;
			event.target.checked = true;
		}

		if (touchInterface) event.target.checked = true;
	}

	if (!obj) return;

	if (cbRotZ.checked)
	{
		obj.rotation.reorder('XYZ');
	}
	
	if (cbRotX.checked)
	{
		obj.rotation.reorder('YZX');
	}
	
	if (cbRotY.checked)
	{
		obj.rotation.reorder('ZXY');
	}
}


